import "./App.css";
import React, { useState } from 'react';
function Uploadvideo() {
  const [showForm, setShowForm] = useState(false);

  return (

      <div><form>
        <button class="uploadVideo_btn" onClick={()=>
    setShowForm(!showForm)}>

        <a href="#0">Upload Video</a>
      </button>
      { showForm ||(
        <form id="form">
        <div>
          <label>Title</label>
          <input type="text" class="input" name="title" required></input>
        </div>
        <div>
          <label>url</label>
          <input type="text" class="input" name="title" required></input>
        </div>
        <div>
          <button class="cancelBtn">Cancel</button>
          <button class="uploadBtn">Upload</button>
        </div>
      </form>
      )}
        </form></div>

  );
}
function Searchvideo() {
  return (
    <div>
      <label>Search:</label>
      <input type="text" class="searchVideo" name="search"></input>
    </div>
  );
}

export default function Search() {
  return (
    <div class="search">
      <Uploadvideo />
      <Searchvideo />
    </div>
  );
}
